import React from "react";
import "./Checkout.css";

function Checkout() {
  return <div className="checkout">
      <div className="checkout__left">
          <img className="checkout__ad" src="https://images.na.ssl-images-amazon." />
      </div>
  </div>;
}

export default Checkout;
